import React from 'react'
import styled from 'styled-components'

const ContainerHead = styled.div`
background-color: black;
color: white;
text-align: center;
font-size: x-large;
align-itens: center;
height: 50px;
`

export default function Header () {

    return (
        <ContainerHead>
        <p> LabeX </p>
        </ContainerHead>
    )

}
